import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Question({getquestionid,questions, setQuestions, id, upVote}) {

    console.log(upVote);


    const dim = index => {
        const newVote = [...questions];
        newVote[index].upVote++
        setQuestions(newVote);
        console.log("Pressed");

    const q = getquestionid(parseInt(id));
    console.log(q);

    return(
        <Paper>
            <h1>Title: {q.title}</h1>
            <p>Question: {q.subtitle}</p>
            <p>Category: {q.category}</p>
            <p>Upvote: {q.upVote}</p>
            <button onClick={dim}>UpVote</button>
        </Paper>
    )
}}
